import './UserDetails.css'

const SubmitData = (props) => {
    console.log('data is being submitted', props);

    return (
        <div>

                <div className='expense-item__description'>
                    <h2>{props.name}</h2>
                    <h2>{props.age}</h2>
                </div>

        </div>
    );
};

export default SubmitData;
